import { Link } from "react-router-dom";

export const MainNavigation = () => (
  <>
    <ul>
      <li>
        <Link to={"/"}>Home</Link>
      </li>
      <li>
        <Link to={"/events"}>Events</Link>
      </li>
    </ul>
  </>
);
